In TypeScript, you can use the `as` keyword to assert the type of a variable or expression. This is often referred to as a "type assertion" or "type-checking assertion".

Here's an example:
```typescript
// Given this code:
interface Animal {
  name: string;
}

interface Cat extends Animal {
  species: "cat";
}

interface Dog extends Animal {
  species: "dog";
}

const animal: Animal = { name: "Fluffy" };

// To assert that animal is a Cat, we can use the 'as' keyword:
const cat: Cat = animal as Cat;
```
In this example, we have three interfaces: `Animal`, `Cat`, and `Dog`. We also have a variable `animal` that is of type `Animal`. We assert that `animal` is a `Cat` by using the `as` keyword and specifying the `Cat` type.

By using a type assertion, you're telling TypeScript that you know the variable has a certain type, even if its type cannot be inferred from the code. This can be useful when you want to ensure that a variable has a specific type, even if TypeScript's type inference algorithm cannot determine it automatically.

Note that while type assertions are a powerful feature, it's important to use them judiciously. If you use them too frequently, you may end up bypassing TypeScript's type-checking system, which can lead to bugs and unexpected behavior in your code.

