\usepackage{tikz}
\usetikzlibrary{chessboards}

\begin{document}

\begin{tikzpicture}[chessboard]
  % Set the dimensions of the board (in squares)
  \setchessboardsize{8x8}
  % Place the board on a new page
  \draw[square] (0,0) grid (7,7);
  % Set the style of the squares
  \draw[square=white] (0,0) -- (7,7);
  \draw[square=black] (0,0) -- (7,7);
