```

This code defines a new `tikzpicture` environment and uses the `chessboard` library to create the board. The `\setchessboardsize` command sets the dimensions of the board to 8x8 squares. The `\draw[square] (0,0) grid (7,7);` command creates a grid of 8x8 squares. The `\draw[square=white] (0,0) -- (7,7);` and `\draw[square=black] (0,0) -- (7,7);` commands set the color of the squares to white and black, respectively.

To place pieces on the board, we can use the `coordinate` command. For example, to place a black pawn on e4, we can use the following code:

```latex
