def lcs(string1, string2):
    # Creating 2D array of size (len+1) x (len+1) 
    # to store the length of longest common subsequence 
    lcs_matrix = [[0 for x in range(len(string2) + 1)] for x in range(len(string1) + 1)] 

    # Filling the matrix 
    for i in range(len(string1) + 1): 
        for j in range(len(string2) + 1): 
            if i == 0 or j == 0: 
                lcs_matrix[i][j] = 0
            elif string1[i - 1] == string2[j - 1]: 
                lcs_matrix[i][j] = lcs_matrix[i - 1][j - 1] + 1
                # lcs_matrix[i][j] = max(lcs_matrix[i - 1][j], lcs_matrix[i][j - 1]) 
            else: 
                lcs_matrix[i][j] = max(lcs_matrix[i - 1][j], lcs_matrix[i][j - 1]) 

    # Finding length of LCS 
    index = len(string1) 
    i = len(string2) 
    lcs_length = 0
    while i > 0 and index > 0: 
        if string1[index - 1] == string2[i - 1]: 
            lcs_length = lcs_length + 1
            index -= 1
            i -= 1
        elif lcs_matrix[index - 1][i] > lcs_matrix[index][i - 1]: 
            index -= 1
        else: 
